[{"location":"input/","page":"Input Options","title":"Input Options","text":"DocTestSetup = quote\n    options = Dict()\n    Nc = 2\nend","category":"page"},{"location":"input/#Reservoir","page":"Input Options","title":"Reservoir","text":"","category":"section"},{"location":"input/#dx,-dy,-dz","page":"Input Options","title":"dx, dy, dz","text":"","category":"section"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Cell size along x, y, z dimension","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Data type","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Type Size\nFloat64 -\nVector{Float64} N_c","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Example:","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"julia> options[\"dx\"] = 50.;\n\njulia> options[\"dy\"] = 50.;\n\njulia> options[\"dz\"] = 10.;\n","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"julia> options[\"dx\"] = 50. * ones(Nc);\n\njulia> options[\"dy\"] = 50. * ones(Nc);\n\njulia> options[\"dz\"] = 10. * ones(Nc);\n","category":"page"},{"location":"input/#Cartesian-Grid","page":"Input Options","title":"Cartesian Grid","text":"","category":"section"},{"location":"input/#nx,-ny,-nz","page":"Input Options","title":"nx, ny, nz","text":"","category":"section"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Number of cells along x, y, z dimension","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Data type","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Type Size\nInt64 -","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"Example:","category":"page"},{"location":"input/","page":"Input Options","title":"Input Options","text":"julia> options[\"nx\"] = 50;\n\njulia> options[\"ny\"] = 60;\n\njulia> options[\"nz\"] = 1;\n","category":"page"},{"location":"api/","page":"Reference","title":"Reference","text":"ResSimAD.change_well_mode","category":"page"},{"location":"api/#ResSimAD.SimMaster.change_well_mode","page":"Reference","title":"ResSimAD.SimMaster.change_well_mode","text":"change_well_mode(sim::Sim, name::String, mode::String, target::Float64)\n\nChange the control mode of well name to be mode with target value target\n\nArguments\n\nsim::Sim: Sim object\nname::String: name of the well\nmode::String: target mode\n\"bhp\": constant BHP\n\"shut\": shut-in\n\"orat\": constant oil rate\n\"wrat\": constant water rate\n\"lrat\": constatnt liquid rate\ntarget::Float64\n\nExamples\n\njulia> using ResSimAD: get_model, change_well_mode\n\njulia> sim, options = get_model(\"example1\");\n\njulia> change_well_mode(sim, \"P1\", \"bhp\", 6200.);\n\njulia> println(sim.facility[\"P1\"].mode)\nCBHP\n\njulia> println(sim.facility[\"P1\"].target)\n6200.0\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"Reference","title":"Reference","text":"ResSimAD.change_well_target","category":"page"},{"location":"api/#ResSimAD.SimMaster.change_well_target","page":"Reference","title":"ResSimAD.SimMaster.change_well_target","text":"change_well_target(sim::Sim, name::String, target::Float64; cut_dt=false)\n\nChange the control target of well name to be target. cut time step to be sim.scheduler.dt0 if cut_dt=true\n\nArguments\n\nsim::Sim: Sim object\nname::String: name of the well\ntarget::Float64\ncut_dt::Boolean\n\nExamples\n\njulia> using ResSimAD: get_model, change_well_target\n\njulia> sim, options = get_model(\"example1\");\n\njulia> change_well_target(sim, \"P1\", 6200.);\n\njulia> println(sim.facility[\"P1\"].target)\n6200.0\n\n\n\n\n\n\n","category":"function"},{"location":"api/","page":"Reference","title":"Reference","text":"ResSimAD.get_well_rates","category":"page"},{"location":"api/#ResSimAD.SimMaster.get_well_rates","page":"Reference","title":"ResSimAD.SimMaster.get_well_rates","text":"get_well_rates(sim::Sim, name::String, data::String)\n\nGet column data from dataframe sim.facility[name].results\n\nArguments\n\nsim::Sim: Sim object\nname::String: name of the well\ndata::String: column name\n\"Time\": Time steps\n\"ORAT\": Oil rate\n\"WRAT\": Water rate\n\"GRAT\": Gas rate\n\"LRAT\": Liquid rate\n\"WBHP\": BHP\n\nExamples\n\njulia> using ResSimAD: get_model, runsim, get_well_rates, SILENT\n\njulia> sim, options = get_model(\"example1\");\n\njulia> runsim(sim, verbose=SILENT);\n\njulia> tstep = get_well_rates(sim, \"P1\", \"Time\");\n\njulia> qo = get_well_rates(sim, \"P1\", \"ORAT\");\n\njulia> length(tstep) > 0\ntrue\njulia> length(qo) > 0\ntrue\n\n\n\n\n\n","category":"function"},{"location":"examples/","page":"Example Models","title":"Example Models","text":"ResSimAD.Models.example1","category":"page"},{"location":"examples/#ResSimAD.Models.example1","page":"Example Models","title":"ResSimAD.Models.example1","text":"example1()\n\nExample model one.\n\nModel description\n\nDimension: 30times15times1\nGrid size: 500times500times200 (ft)\nPermeability: 200.0 md\nPorosity: 0.2\nFluid: Oil-Water\nInitial pressure: 6000.0 psi\nInitial water saturation: 0.1\nWells:\nP1: producer at (1, 1, 1), constant BHP 5500.0 psi\nI1: injector at (30, 15, 1), constant BHP 6500.0 psi\nSchedule:\ndt0: 0.1 Day\ndt_max: 50.0 Day\nt_end: 1825 Day\n\n\n\n\n\n","category":"function"},{"location":"#ResSimAD.jl","page":"Home","title":"ResSimAD.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"(Image: Build Status)","category":"page"},{"location":"","page":"Home","title":"Home","text":"(Image: )","category":"page"},{"location":"","page":"Home","title":"Home","text":"A reservoir simulator in a modern programming language.","category":"page"},{"location":"#Features","page":"Home","title":"Features","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Interactivity: run simulations in interactive programming environments such as Jupyter notebook or Juno. With the PyJulia python module, ResSimAD.jl is also accessible from Python.\nDynamic control: run simulation timestep by timestep, or newton step by newton step, and modify parameters or controls dynamically.\nReal-time feedback: extract reservoir dynamic states for analysis and visualization.\nDistributed computing: with packages such as ClusterManagers.jl, it is very convenient to run multiple simulations in parallel on a HPC cluster. This is very useful for field optimization and history matching.","category":"page"},{"location":"#Automatic-Differentaition-(AD)","page":"Home","title":"Automatic Differentaition (AD)","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"An operator-overloading-based forward mode AD framework is developed to compute gradients automatically. Instead of using existing Julia AD packages such as Zygote, Tracker or DualNumbers, a customized AD framework is developed here for the sake of efficiency. The AD framework underlying ResSimAD.jl is tailored for the operations in reservoir simulation. This allows maximum level of optimization which makes this AD framework almost as fast as hand-written differentiation. On the other hand, the AD framework may need to be extended if some new operations are introduced when extending the functionality of ResSimAD.jl.","category":"page"},{"location":"#Functionality","page":"Home","title":"Functionality","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Functionality-wise, ResSimAD.jl is still at a very early stage. It currently works for simple simulation models:","category":"page"},{"location":"","page":"Home","title":"Home","text":"Grid: 3D Cartesian grid\nFluid: two phase (oil-water) dead oil\nWell: single perforation","category":"page"},{"location":"","page":"Home","title":"Home","text":"But the underlying framework of ResSimAD.jl is designed for easy extension for more complex simulation models, such as those with unstructured grid, three-phase black oil fluid model, wells with multiple perforations. This is largely facilitated by the powerful type system and multiple dispatch in Julia, and the AD framework.","category":"page"},{"location":"","page":"Home","title":"Home","text":"Extensions to more complex problems, such as compositional fluid models, multi-segment wells, require more effort. The current AD framework is highly optimized for black oil models and standard wells. Extending the AD framework to handle compositional models, advanced wells and maintaining the same level of efficiency will require some effort. These will not be the focus for ResSimAD.jl for now.","category":"page"},{"location":"#Performance","page":"Home","title":"Performance","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"For a limited number of test problems, the speed of ResSimAD.jl is comparable to, and in some cases even faster than, Eclipse and ADGPRS. This is very impressive given that ResSimAD.jl is written in pure Julia and that ResSimAD.jl uses AD. This is largely facilitated by","category":"page"},{"location":"","page":"Home","title":"Home","text":"The fast speed of the Julia language, especially the highly optimized array broadcasting, which makes it possible to completely avoid the overhead of memory allocation induced by operator-overloading-based AD.\nResSimAD.jl currently uses the GMRES + ILU linear solver from the IterativeSolver.jl package. For the simple problems that ResSimAD.jl currently supports, it is efficient enough.\nFile IO can be completely avoid when using ResSimAD.jl in an interactive environment. Simulation results can stay in memory before they are analyzed or visualized for downstream tasks.","category":"page"},{"location":"#Installation","page":"Home","title":"Installation","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"ResSimAD.jl is currently a private repository. If you have access to this repository, please download the source code. Then install manually with","category":"page"},{"location":"","page":"Home","title":"Home","text":"] add ResSimAD.jl","category":"page"},{"location":"#Examples","page":"Home","title":"Examples","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Example models are available in src/models/","category":"page"},{"location":"","page":"Home","title":"Home","text":"Code for simulating the example models is available in examples/","category":"page"},{"location":"#Contents","page":"Home","title":"Contents","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"#Index","page":"Home","title":"Index","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"","category":"page"}]
